NEW: RUDY GIULIANI briefed MIKE POMPEO in late March on claims about BIDEN, YOVANOVITCH, etc.

@SecPompeo called back &amp; asked "Do you have any backup?"

So @RudyGiuliani had notes of his Ukrainian interviews hand-delivered to Pompeo in a @TrumpDC envelope. https://t.co/s51kB4K8p6

McConnell has already made it clear to Trump that the GOP doesn’t have the votes to dismiss the trial outright. 

McConnell also knows if it gets there, it’s going to be ugly.

That’s why I still think Trump will resign. &lt;FIN&gt;
